import './App.css';
import data from './input.json';

function App() {
  console.log(data);
  const renderJson = data => {
    return (
      <ul>
        <li key={element.title}> {element.type} </li>
        {element.children.map((child) => (
          renderJson(child)
        ))}
      </ul>
    )
  }
  return (
      <ul>
        {data.map((element) => (
          <li key={element.title}> {element.type} </li>
        ))}
      </ul>
  );
}

export default App;
